ecesito que ayuden con eso \ngracias'), ('5605', 'FANNY', '0986943571', '2015-06-02 18:42:21', 'fannysglendatur@hotmail.com', 'Hola cómo están? Disculpen envié un mensaje de texto con los 5 últimos dígitos y recibí la contestación que había ganado una mochila de la promoción. Quiero saber como hago para retirar mi premio o me envían a la dirección que registré.\nSaludos\nFanny'), ('5606', 'dayanna licoa', '2047678', '2015-06-02 20:59:29', 'dayanalicoa@hotmail.com', 'cuando son las entregas de los premios'), ('5607', 'dayanna licoa', '2047678', '2015-06-02 21:06:57', 'dayanalicoa@hotmail.com', 'cuando sera la entrega de los premios instantaneos'), ('5608', 'PIERINA DE RIVERA', '0997855281', '2015-06-02 22:48:13', 'piernel2006@hotmail.com', 'acabo de comprar enfagrow Premium presentación 1200 kg pre escolar y envie al 3632 los 5 dígitos últimos y me llego la confirmación de haber ganado una lonchera doki e ingrese un código para reclamar el premio pero no sale nada. DONDE DEBO IR A RETIRAR EL PREMIO Y QUE DEBO PRESENTAR GRACIAS POR SU PRONTA RESPUESTA  '), ('5609', 'RAFAELA CEREZO', '0968277767', '2015-06-02 22:53:14', 'viracp@hotmail.com', 'hola estoy ingresando el codigo que me llego que me indica que me he ganado una mochila y no me acepta el codigo como me pueden ayudar por favor'), ('5610', 'Luisa Gabriela Macias Cano', '0993297154', '2015-06-03 00:12:50', 'barcelonistasexy@hotmail.com', 'Canjear premio\n\n'), ('5611', 'GABRIELA VALLEJO SOLEDISPA', '0993285274', '2015-06-03 00:15:41', 'natalygaby88@outlook.com', 'HOLA MUY BUENAS NOCHES, POR FAVOR AYUDEME EN DONDE PUEDO RETIRAR DOS LONCHERAS DE DOKI QUE MI HIJO SE GANO POR FAVOR LLAMAR O ENVIARME INFORMACION A MI CORREO....\nGRACIAS POR SU ATENCION\nBUENAS NOCHES'), ('5612', 'mariela romero sandoya', '0986529394', '2015-06-03 02:12:54', 'marielitakm26@hotmail.com', 'Hola k tal.. soy la persona k escribio porq no puedo ingresar los codigos no los acepta y tengo ganadas 3 loncheras me respondieron k envie los codigos. 0OZ0CG  FQ4OBV '), ('5613', 'JORGE VILLANUEVA SAQUICELA', '2578301', '2015-06-03 02:14:41', 'jorge0344villanueva@hotmail.com', 'HOLA BUEN DIA,DISCULPE YO INGRESE EL CODIGO D LA LATA DE LECHE Y ME SALIO Q GANE UNA MOCHILA INGRESE EL CODIGO Y MIS DATOS PERO AL MOMENTO DE REGISTRAR LO HAGO PERO NO SALE NADA QUISIERA SABER SI ESTOY O NO REGISTRADO MI CODIGO ES G8EW3H  POR FAVOR LLAMENMEN POR TELEF PARA ESTAR TRANQUILO D Q MI PREMIO ME LLEGARA ..GRACIAS'), ('5614', 'KARINA CAICEDO', '0988976383', '2015-06-03 11:17:49', 'karyedercb@yahoo.com', 'hoy recibi un biberon de parte de enfagrow pero en el mensaje me llego que era una mochila de doki'), ('5615', 'CRISTINA PERALTA', '0939824605', '2015-06-03 11:19:28', 'clpb15@hotmail.com', 'he comprado 4 latas de leche las cuales tienen el mismo codigo que son los 5 ultimos digitos del codigo de barra 05158 he enviado el sms y me sale incorrecto, me puede decir q esta mal.'), ('5616', 'SUSANA GINES SANTISTEVAN', '042346959', '2015-06-03 12:57:52', 'santosgines@hotmail.es', 'ESTIMADOS\nEL DIA 19 DE MAYO ENVIE UN MENSAJE DE TEXTO EL CODIGO DE LA CAJA DE ENFAGROW PREESCOLAR Y ME ENVIARON UN MENSAJE DICIENDO QUE GANE UNA LONCHERA DOKI INGRESE EL CODIGO QUE ME ENVIARON REGISTRE MIS DATOS PERO AUN NO HE RECIBIDO LA LONCHERA. FAVOR INFORMENME QUE OCURRIO.\nGRACIAS \nSALUDOS CORDIALES \nSUSANA GINES S.'), ('5617', 'Ivan Jonathan Castro Molina', '2400491', '2015-06-03 13:05:55', 'ijcm_91@hotmail.com', 'Buenos Dias el dia 19-Mayo-2015 ingrese el codigo de una enfagrow de 1200 gramos. Me respondieron que soy uno de los ganadores de 1 Mochila doki. Ingrese a la direccion con el codigo que me dieron y nada que me dan el premio.\nQue paso señores. Espero una respuesta\nGracias'), ('5618', 'Raffaella Martrus Alejando', '042078090', '2015-06-03 13:06:34', 'raffito_2@hotmail.com', 'Aun no recibibo mis premios son 2 loncheras envie los codigo el mes pasado'), ('5619', 'lenny limon', '0985185751', '2015-06-03 18:52:17', 'len.y789@hotmail.com', 'C