ear el premio gacias'), ('5630', 'Angélica villamar quinto', '0991482536', '2015-06-04 12:58:29', 'Fernandoatocha@Hotmail.com', 'Mi hijo aprendió a tomar esta leche enfagrow'), ('5631', 'dayanna licoa', '2047678', '2015-06-04 13:06:13', 'dayanalicoa@hotmail.com', 'cuando me llegara el premio instantáneo que gane '), ('5632', 'Diana Magdalena Meza Bravo', '0993432752', '2015-06-04 15:16:18', 'dmezabravo@hotmail.com', 'tengo guardado los 4 últimos tarros de leche.  porq tienen los mismos dígitos en los códigos.'), ('5633', 'kqtherine torres', '0988338481', '2015-06-04 15:48:59', 'kattyka-904@hotmail.com', 'en donde puedo reclamar el premio ya ingrese el codigo en la pagina'), ('5634', 'Evelyn González Cevallos', '0993833300', '2015-06-04 16:01:50', 'eve_gonzalez1985@hotmail.com', 'Estimados:\nRecibi un mensaje de la promoción Aprendiendo con Doki, en el cual se me indicaba que era ganadora de la mochila de Doki.\nRegistre mis datos pero no me queda claro si lo recibiré en mi domicilio o lo puedo ir a retirar a un punto de entrega.\n\nAgradezco mucho por su respuesta.\n\n'), ('5635', 'Darwin Orrala Borbor', '0998652747', '2015-06-04 20:13:23', 'dorrala@liris.com.ec', 'No puedo ingresar el codigo que me enviaron por SMS para reclamar mi premio, por favor indicarme como debo hacerlo.'), ('5636', 'monica olvera', '0988317867', '2015-06-04 22:57:38', 'ovanessamacias@gmail.com', 'me gane una mochila como o donde la retiro'), ('5637', 'MARJORIE RIVERA ', '0985098549', '2015-06-04 23:00:37', 'winnie26mayito@hotmail.com', 'HOLA QUISISERA SABER COMO HAGO PARA CANJEAR MI PREMIO EN EL MENSAJE ME SALIO QUE GANE UNA MOCHILA PERO INGRESO EL CODIGO Y ME SALE REGISTRARME Y YA QUEDO REGISTRADO VUELVO A INGRESAR EL CODIGO Y NO SALE NADA X FAVOR AYUDEME PARA NO PERDER MI PREMIO '), ('5638', 'Marjorie del rosario Liverio barrientos', '0986619138', '2015-06-05 00:28:06', 'Mayi-liverio@Hotmail.com', 'Consumo'), ('5639', 'Vanessa Yahaira Lopez Lopez', '0983478895', '2015-06-05 09:19:48', 'vane5832@hotmail.com', 'Buen día \nTengo una consulta pues me hice acreedora a una mochila de doki ya me registre y todo el procedimiento pero aun nadie se ha comunicado conmigo para hacerme la entrega. Por favor me pueden ayudar con este inconveniente ya ha pasado mas de una semana puesto q en la promocion anterior tambien tuve los mismos problemas.\n\nGRACIAS POR LA ATENCION\n\nVanessa Lopez\n0983478895'), ('5640', 'dayanna licoa', '2047678', '2015-06-05 11:39:49', 'dayanalicoa@hotmail.com', 'hola quiero saber cuando recibiré mi premio instantaneo'), ('5641', 'RAMIRO JAVIER BONILLA YANEZ', '0979646856', '2015-06-05 12:42:16', 'javierbonilla1986@hotmail.com', 'Muy buenos dias quisiera saber porque no me llega la mochila que me gane ya es mas de quince dias que ingrese el codigo si me puede ayudar muchas gracias '), ('5642', 'Juneslye Inés Pinela Villacís', '0987393705', '2015-06-05 12:48:53', 'jpinela@ecorecicla.com.ec', 'Estimados, El 19 de Mayo luego de enviar el código del tarro de leche de mi nena recibí un mensaje de texto indicando que nos ganamos una mochila Doki y que debía ingresar un código a su página. Lo realizé pero aún no recibo el premio. Ojalá puedan ayudarme porque mi nena está muy ilusionada con su premio.\n\nGracias'), ('5643', 'Maria Isabel Solorzano Risco', '052757993', '2015-06-05 19:26:28', 'solorzanoisabel@outlook.es', 'Hola como estan.... todos los codigos de los tarros de leche de 800g son los mismos.... yo ya envie un codigo de un tarro que compre la semana pasada y si envio otra vez el mismo codigo pos kizas me lo van a rechazar'), ('5644', 'Celeni Serrano Toala', '042047121', '2015-06-05 20:23:14', 'celmise2416@hotmail.com', 'me regiistro para participar en el sorteo de un año del producto enfagrow premiun pero no me sale un mensaje que me indique que ya me he registrado'), ('5645', 'evelyn cabrera lozano', '0981914976', '2015-06-06 00:03:05', 'geomylo@hotmail.com', 'Donde puedo reclamar mi premio diganme la dirección'), ('5646', 'henry z