63', 'Nicole Menoscal', '0980031150', '2015-06-08 13:22:02', 'nicki_dark@hotmail.com', 'Buenos Días,\nYo ingrese el codigo de la promo x mensaje y me respondieron q gane una mochila de doki\nquisiera saber donde reclamo el premio??? llamenme al celu \ngracias!!!!'), ('5664', 'Katherin Lissette Espinoza Gomez', '0968896181', '2015-06-08 15:52:44', 'laflak_kata@hotmail.com', 'Sres. enfagrow  aun espero mi premio mi codigo salio favorecido para una mochila ya ingrese los datos y aun no me llega mi premio esta ya es la 3era semana que lo espero y nada.. o digan donde lo puedo ir a retirar por favor respondan...!!!! '), ('5665', 'LUIS FABRICIO SILVA CRUZ', '0993079449', '2015-06-08 21:07:18', 'luis_fabricios@hotmail.com', 'Estimados:\nHace mas de 15 dias envie mis datos para que me hagan la entrega de una mochila de Doki que me gane pero hasta el dia de hoy llega a mi domicilio.\nEn espera de su respuesta.\n'), ('5666', 'Danny Rodrigo Minchala Carbo', '0994378704', '2015-06-09 02:41:47', 'dannyminchala@Yahoo.com', 'Mensaje *sr enfagrow yo gane x mensaje d texto una lonchera oki doky. y dicen q llega despues d 15 dias d haberse ingresado el codigo. yo lo ingrese en el mes d mayo y aun no recibo la lonchera. adjunto mi dirección d nuevo : Guayaquil calle 37 ava (2011) entre Rosendo Avilés y Chambers casa de dos pisos beige y rejas concho d vino. a lado d mi casa hay una mata d guayaba. '), ('5667', 'Danny Rodrigo Minchala Carbo', '0982720537', '2015-06-09 03:09:16', 'dannyminchala@yahoo.com', 'Sres Enfagrow yo como consumidor les escribo que hace mas d 15 dias ingrese mi codigo premiado con una lonchera oki doky y en los terminos y condiciones leyendo dice q esos premios los entregan despues d 15 dias d haberse registrado aqui. yo ingrese mis datos el 2 d mayo 2015 y aun no recibo la lonchera q gane,  hoy hago de nuevo mi registrox este medio , necesito respuestas d ustedes para saber si consto en el registro o q debo hacer para q me entreguen el premio, gracias nuevament mi correo es'), ('5668', 'FRANCO BAJAÑA DANIEL SAUL', '0958860348', '2015-06-09 10:19:42', 'santijoelfranco@hotmail.com', 'Buenos dia estimados le saludo y a la vez le hago la pregunta acerca de un premio que sali sorteado una mochila especificamente pero no eh tenido respuesta alguna acerca de donde debo o como me van hacer la entrega del mismo \nDe antemano por la atencion prestada me suscribo de ustedes \nAtte.\nDANIEL FRANCO BAJAÑA'), ('5669', 'Viviana Silva arellano ', '0979970676', '2015-06-09 13:32:27', 'lorenaviviana74@hotmail.com', 'Estimados yo le doy la leche a mi bebe desde su primer día de nacida  enfamil primien De 0 a 6 meses despues de 6 A  12 meses y ahora que ya cumplió un ano el pediatra me dijo que ya  tenía que consumir enfragrow de un año vi la promoción y estoy aprovechando ya que esta la edad de mi bebe ha tomado más de 50 tarros de 800 MG ahora nos toca la enfragrow, los felicito muy buena leche quien fue el pediatra que nos tecomendo la leche fue el Dr Bolano de la clinica Kennedy '), ('5670', 'viviana Silva', '0979970676', '2015-06-09 13:41:22', 'lorenaviviana74@hotmail.com', 'Por favor no puedo ingresar el código h comprado dos tarro de 800mg que tienen el mismo código que es 05172 y no se como ingresar en el intert '), ('5671', 'Guisella Estrada', '0989810742', '2015-06-09 19:21:14', 'guisellaestrada28@gmail.com', 'Yo me gane una mochila  hace dos semanas y nada q me la bien a dejar donde puedo ir para reclamarla'), ('5672', 'stefania Hilaca', '0999550606', '2015-06-09 23:14:45', 'stefania-h22@hotmail.com', 'Mis estimados la presente es x la promocion de las mochilas y demas del personaje doki hace un mes compre un tarro de leche pequeño en el cual sali favorecida de una mochila ingrese mis datos y los de mi domicilio pero hasta la fecha me llega el premio.\nla verdad me siento decepcionada xq el producto es muy bueno (enfagrow premiun) pero es una lastima q no cumplan con la promociob \nEspero me den una respuesta favorable'), ('5673', 'Zaide matamoros rubio', '0993714861', '2015-06-10 13:03:29', 'Zaide1976@hotmail.com', 'Estimados sres de Enfagrow yo registro mis datos y en el registro que se abre pero al momento de enviarlo no se va.Fuera de esto yo participe en la promocion anterior y gane fos premios y hasta ahora lo e recibido espero una respuesta.gracias'), ('5674', 'SUSANA GINES SANTISTEVAN', '042346959', '2015-06-10 13:16:12', 'santosgines@hotmail.es', 'ESTIMADOS VUELVO A ESCRIBIRLES INFORMANDOLES QUE NO HE RECIBIDO LA LONCHERA QUE ME DIJERON EN EL MENSAJE QUE ME HABIA GANADO CUANDO INGRESE EL CODIGO DE ENFAGROW PREESCOLAR.\nFAVOR SOLUCIONAR ESTE INCONVENIENTE\nSALUDOS\nSUSANA GINES S,'), ('5675', 'priscila maya', '0990328944', '2015-06-10 22:04:31', 'prismaya_19@hotmail.com', 'Buenas noches disculpen el 20 de mayo me registre  y envie el mensje al 3632 h me respondieron que me habia ganado una lonchera y aun no me ha llegado po r favor necesito me indiquen el motivo gracias '), ('5676', 'Gloria Guisela Franco Vergara', '3096101', '2015-06-11 00:18:51', 'crisyguic@hotmail.com', 'Senores disculpas me gane 2 loncheras y no tengo respuesta favor que debo de hacer segui todos los pasos.....\nRuego me comuniquen algo o solo se dice que gane y alli quedo todo?????Gracias'), ('5677', 'Alberto Hernandez', '0990210609', '2015-06-11 00:53:27', 'pbeto78@hotmail.com', 'Que codigo ingreso su ayuda x favor.'), ('5678', 'ANGELICA CORONEL PALMA', '0988049207', '2015-06-11 01:06:32', 'acoronel77@hotmail.com', 'Estimados me gane una lonchera pero hasta la fecha la recibo digame donde la puedo ir a retirar. '), ('5679', 'genesis carolina carbo flores', '0989712813', '2015-06-11 11:09:19', 'carolina_carbo96@live.com', 'deseo saber porque aun no me llega el premio ya a pasdo mas de 20 dias desde el ingreso del codigo y me digeron que solo eran 15 dias para que llegue el premio entonces como se si no tengo que ir a retirarlo a algun lado o llamar para pasar por el \n\npor favor contactecme para saber del premio'), ('5680', 'ana jahaira salazar tascon', '0981049780', '2015-06-11 12:10:47', 'anitaj2014@hotmail.com', 'ola aun no me visitan para la entrega del premio de mi bebe'), ('5681', 'miguel tomala ramos', '0981522016', '2015-06-11 15:49:43', 'tomial_76@hotmail.com', 'hola por favor me enviaron este codigo 30eiky sali fvorecido con una lonchera pero ingreso y me sale un mensaje que esta incorrecto por favor confirme cual es el error'), ('5682', 'Jose Ronda Mejia', '0980066666', '2015-06-11 15:52:24', 'pepe_ronda@hotmail.com', 'buenas tardes, necesito me ayuden como canjear una lonchera de Doki, envie el codigo al 3632 me salio que gane, ingrese mis datos en la pagina web y aun no se comunican conmigo para la entrega del premio, ya han pasado mas de 20 dias\nagradeceria me informen como obtener el premio para mi hijo\nGracias.'), ('5683', 'Adriana Moncayo', '0990098648', '2015-06-11 16:40:31', 'adrys720@hotmail.com', 'al ingresasr el codigo de la leche q le compre a mi hijo me llego un mensaje a mi celular que mi hijo fue ganador de una lonchera entonces me hacen llegar el premio o solo es marketing me gustaria saber si es verdad o no'), ('5684', 'Leonel villon garcia', '2474269', '2015-06-11 18:30:42', 'Lvillon.g@hotmail.com', 'Cuando fue la otra promo me gane una tablet k jamas me entregaron lo demas si k fue un aplastador ee fruta y un tomatodo pero la tablet nooo y no es asi deben ser leales  pero voy a  buscar los codigo k venian en la tapa'), ('5685', 'Bethsy Bedón Velásquez', '0984580753', '2015-06-11 18:41:54', 'bbedon@hotmail.com', 'Recibi un mensaje el 29 de mayo del 2015 en el cual se indica que había ganado una lonchera  Doki , como consecuencia de haber enviado el sms al 3632  con los digitos del codigo de barras del enfragrow que compre. Esa misma noche registre mis datos  en su sitio. Sigo a la espera de se me haga entrega del premio indicado.\n\ngracias por sus comentarios'), ('5686', 'JESSICA SOLANGE BECILLA VERA', '0989269183', '2015-06-11 18:45:48', 'Jbecilla@live.com', '05172'), ('5687', 'Evelyn Paola Lema Flores', '0959706167', '2015-06-11 19:10:49', 'pao_lemaf_789@hotmail.com', 'b tardes el motivo por el cual escribo es porque yo ingrese el codigo por este medio y aun no he recibido el respectivo obsequio que m salio que hgane una lonchera,,el premio salio que seria entregado a do,icilio..de pronto me pueden explicar los motivos el cual no llega??y otra pregunta...aun puedo ingresar el codig d barras(los ultimos 5 digitos de los otros tarros de leche q he comprado ahora asi no tenga el stikerd ??)porque he adquirido el de la nueva presentacion y ese no tiene stikers par'), ('5688', 'Yaritza tigua', '0981921338', '2015-06-11 20:14:23', 'Jaritzalisxc_@gmail.com', 'Hola buenas tarde yo me gane una lonchera y no se donde retirarla cq consulto y no sale nada'), ('5689', 'alexandra cabrera holguin', '0991900233', '2015-06-11 21:31:15', 'alexicabrera@hotmail.com', 'Recibï mensaje de haberme en mi teléfono de haber ganado una mochila y aún no me han hecho la entrega de mi premio.'), ('5690', 'JOHANNA ELIZABETH CAMPAÑA ROMAN', '0997009719', '2015-06-11 22:52:03', 'johacampana6@hotmail.com', 'El mensaje enviado dice q me gane una mochila como es el tema de entrega.\nSaludos\nJohanna'), ('5691', 'Rosa elena vasconez bustamante', '0979532185', '2015-06-11 23:16:06', 'roele1979@gmail.com', 'Como Canjear premio mochila '), ('5692', 'RICARDO VLADIMIR CRUZ SAILEMA ', '0985877039', '2015-06-12 00:14:01', 'ricardocruzsailema@hotmail.com', 'por favor como ganador dela loncherade doki, enviarme a galapagos sancristobal el progreso,calle manuel julian cobos, o como hacemos para retirar el premio '), ('5693', 'LISSETTE CALI CORTEZ', '042617676', '2015-06-12 11:41:17', 'lcali@espol.edu.ec', 'Buenos días estimados, el motivo de mi correo es porque yo me gane una mochila doki, quisiera saber como hago para retirarlo, yo ingrese el codigo a la pagina que sale y complete los datos que me pidieron pero aun no tengo respuesta alguna. Ya esto es casi 2 semanas que envie mis datos. EL CODIGO QUE ME SALIO ES AXZY5X. Esperando su pronta respuesta, les quedo agradecida.\n\nLissette Cali.'), ('5694', 'CINTHYA MONSERRATE CASTILLO TRIVIÑO', '2644589', '2015-06-12 12:35:56', 'CCASTILLO0761@UTM.EDU.EC', 'ESTE ES MO CODIGO UDHQ8M Y ME SALIO QUE GANE UNA LONCHERA DOKI COMO HAGO PARA RETIRARLA'), ('5695', 'Rubi Morales', '0990050970', '2015-06-12 12:57:01', 'rubimoralesmora71@gmail.com', 'Buenos días como hago para retirar el premio yo ingrese el código y me salió que me gané una lonchera y no me ha llegado todavía o donde tengo que retirarla............. y recien ingresé otro código pero no me sale nada..'), ('5696', 'Mirna torres', '0999767574', '2015-06-12 13:11:09', 'doblem1012@hotmail.com', 'Si mi niño lo toma aun desde los nueve meses el tiene dos año ');
INSERT INTO `doky_contactanos` VALUES ('5697', 'CARLOS JUNGNIKEL', '0968070005', '2015-06-12 14:45:59', 'c_jungmat2004@yahoo.com', 'Estimados Srs. yo me registre por un premio que me gane, una lonchera di mi direccion de la casa para la entrega de la misma y hasta el dia de hoy no he recibido el premio ni peor aun una llamada para notificarme del premio \nmi numero de cedula 0920719796 '), ('5698', 'mariela romero sandoya', '0986529394', '2015-06-12 16:49:59', 'marielitakm26@hotmail.com', 'Hola nuevamente...!! La verdad es k nuevamente quiero ingresar los codigos y no m permite solo m registro x un año de leche gratis k eso no mas m sale.. pero de ahi nada mas.. incluso acabo de comprar otra leche d 800gr y resulta k tiene el mismo codigo del anterior tarro.. como se cuando entregan lo k m salio enviando los codigos.. se le agradece su pronta respuesta..'), ('5699', 'JULEXI ESTEFANIA MUÑIZ ESPINOZA', '0988058791', '2015-06-12 17:39:19', 'july_chiqui96@hotmail.com', 'hola doki espero que mi hija sea una de las ganadoras para que te pueda conocer'), ('5700', 'Luis Sepúlveda', '0995721186', '2015-06-12 18:05:04', 'weichafe.chile@gmail.com', 'Estimados:\n                                   he tratado de ingresar un sinnumero de códigos ya que compro mucho este tipo de leche para mi hijo y todos me salen como código incorrecto, me he topado que en algunos casos se repiten los códigos tanto en cajas como tarro individuales, me pueden explicar que esta pasando? realmente me tiene molesto el tema, espero una explicación que sea coherente.\n\nAtte.\nLuis Sepúlveda'), ('5701', 'NANCY PINARGOTE', '0984074808', '2015-06-13 01:30:08', 'naoti_81@hotmail.com', 'como hago para particiàr'), ('5702', 'ANGELICA MARIA MOSCOSO DEL ROSARIO', '0987193989', '2015-06-13 10:45:21', 'angelicamoscoso_1704@hotmail.com', 'muy buenos dias me llego un mensaje que habia ganado una lonchera de doki y quisiera saber donde puedo ir a retirar el premio, vivo en machala el oro ecuador.\npor su ayuda quedo agradecida'), ('5703', 'Ruth  Esther Arias CASTRO', '0984477056', '2015-06-13 12:59:04', 'estherariasc@hotmail.com', 'Es un muy buen pproducto gracias por los beneficios q da al niño'), ('5704', 'andrea lata', '0981195191', '2015-06-13 14:32:40', 'aslatabarrera2012@hotmail.com', 'envíe un código premiado donde me dijeron que habia ganado una mochila hace mas de 15 días estoy esperando la llamada y nadie se manifiesta que solución me pueden dar'), ('5705', 'Graciela Janeth Barcia Bravo', '0985353154', '2015-06-13 17:49:21', 'gbarcia16@outlook.com', 'Es una excelente leche ayudo a mi hijo a subir de peso'), ('5706', 'GILDA  ALVAREZ', '6012693', '2015-06-13 22:20:32', 'gab_tecnologia@hotmail.com', 'Señores hace varios dias ingresé en esta página el código por haber ganado una lonchera de DOKI pero hasta la fecha no me llega nada ynadie si ha contactado conmigo.\nEspero sus noticias.'), ('5707', 'andrea enriquez carrion', '0984910032', '2015-06-13 23:06:11', 'andrea81enriquez@hotmail.com', 'Estimados:\nQue gusto contactarlos, mi hijo tiene 7 años de edad y desde que el nació hemos sido fieles con su producto desde que iniciamos con enfamil prematuros hasta la actualidad con enfagrow preescolar. Toda una dulce vida desde el primer día del nacimiento de mi bebe.\nEl presente es porque quise contactarlos y llenar los datos para participar de la promoción porque fue mi hijo quien me aviso de la promoción y creo que no he podido hacerlo con éxito. Salio que registre el código MOKK1H pero '), ('5708', 'Lisette meza vega', '0986981991', '2015-06-13 23:52:32', 'Lmezavega@hotmail.com', 'Donde voy a retirar la mochilita que me gane '), ('5709', 'Isabel Bravo', '0995970955', '2015-06-14 00:03:29', 'hilda_chabi@hotmail.com', 'Estimados hace mas de 20 días registre mi código y me gane una mochila, registre mis datos pero aun no me contactan para la entrega del premio.\n\nAgradeciendo su pronta atención.\n\nIsabel Bravo Indacochea'), ('5710', 'CECILIA GUILLEN HERMOZA', '0984361794'