2015-06-25 00:31:54', 'americalarrea@yahoo.com.ar', 'Por favor quisiera que me indiquen cual codigo de barra envio en el mensaje ya que los empaques tienen los mismos codigos de barra '), ('5781', 'Kimberly Cobos', '2679548', '2015-06-25 21:16:15', 'chinita_94kim@hotmail.com', 'buenas noches, un gusto saludarles. Queria decirles que yo el dia 2 de junio envie un msj al 3632 con el codigo de barra y m dijeron. Felicitaciones eres uno de los ganadores de 1lonchera Doki y e ingresado el codigo pero no recibo resp alguna d uds..\nesa es mi inquietud'), ('5782', 'Jonathan solano', '0993952186', '2015-06-26 00:33:50', 'jsolano.gye@hotmail.con', 'Buenas noches hace mas de 15 dias envie el codigo me ise acreedor a una lonchera y aun no me llega deseo saber el motivo. Gracias'), ('5783', 'Maria Jose Dominguez Lucin', '0980078600', '2015-06-26 01:25:12', 'mj_dominguezl_11@hotmail.com', 'Yo recibi jn mensa donde me indicaron que habia ganado una lonchera  y que en 15 dias me entregaban el premio pero hasta lafecha indicarme donde luedo retirar el premio'), ('5784', 'BERTHA SOLANGE MENA AVILA', '0992604676', '2015-06-26 18:20:31', 'soly_1986199@hotmail.com', 'Quiero retirar la mochila que me gane \nindiqueme en donde la retiro '), ('5785', 'katherine zurita', '0997373268', '2015-06-26 21:40:01', 'kdsierraz@hotmail.com', 'c0mo puedo retirar el premio de la mochila doki'), ('5786', 'lady bajaña litardo', '756395', '2015-06-27 00:25:31', 'stefyjohana@hotmail.es', 'contenta por la promocion enfagrow premiun estoy muy feliz y alegre qu emocion de ser una ganadora'), ('5787', 'Rossana Vera', '0980986170', '2015-06-27 01:17:53', 'rossanaveravera@yahoo.es', 'Hola...\nHe recibido un mensaje indicándome que me gane una mochila, dónde puedo retirarla?? \nGracias.'), ('5788', 'Rita Maria Zambrano Rivadeneira', '2698653', '2015-06-28 17:30:33', 'ritamaria.1822@gmailcom', 'Muy buen producto'), ('5789', 'Jose fernando alcivar garcia', '2699389', '2015-06-28 17:32:57', 'a.josefernando@gmail.com', 'Excelente producto'), ('5790', 'gabriela vanessa lainez pozo', '2941297', '2015-06-29 12:12:30', 'gabrielalainez87@gmail.com', '05172'), ('5791', 'Magaly', '042664127', '2015-06-29 17:08:40', 'm.aggi47@hotmail', 'Hola.. Buenas tardes.. Mi requerimiento es el siguiente de q la promocion de enfagrow yo hice todo el procedimiento x internet para poder ganar algo a lo q me salio una mochila lo cual hasta el dia de hoy no me han entregado y no quisiera quedarme sin premio para mi hija'), ('5792', 'Julissa Aguillon', '0996589280', '2015-06-29 18:03:33', 'jaguillon23@hotmail.com', 'Deseo participar '), ('5793', 'norma solano', '0997272827', '2015-06-29 20:46:22', 'alejasolano20@hotmail.com', 'un buen producto'), ('5794', 'kerli sarmiento Mieranda', '0988728525', '2015-06-30 12:58:40', 'chiquitak10@hotmail.com', 'Estimados:\n\nPor este medio tengo a bien informarles que 1hasta el dia de hoy me ha'), ('5795', 'Lcda. Kerli Sarmiento Miranda', '0988728525', '2015-06-30 13:07:08', 'chiquitak10@hotmail.com', 'Estimados:\n\nPor medio del este medio les comunico que hasta la fecha de hoy no he recibido el premio (mochila) al cual he sido ganador; por lo cual solicito me comuniquen el inconveniente suscitado por parte de ustedes para la demora el premio antes mencionado.\nPor lo anteriormente expuesto tengo a bien informarles mi dirección de trabajo y numero de teléfono para el contacto:\nsubcentro de salud cumandad\ncell 0988728525'), ('5796', 'tatiana vinueza', '0993960047', '2015-06-30 13:33:18', 'tativinueza@hotmail.com', 'por los códigos de barra son los mismos en varias ocaciones  el código es el mismo y he comparado el que viene el contenedor gratis el envase de 1200 gramos y este fin de semana compro de 1200gramos una nueva presentación y el código es el mismo termina 05165 sale código incorrecto y luego llega otro sms que me regriste en la pagina de la promoción ??????');
INSERT INTO `doky_contactanos` VALUES ('5797', 'selena lucero', '0959299657', '2015-06-30 14:05:05', 'selena.lucerollanos@yahoo.com', '05172'), ('5798', 'Penélope Nathaly Tello Jiménez', '0982211022', '2015-06-30 15:41:45', 'penelopetello86@gmail.com', 'Buenas tardes, he comprado varias cajas de enfagrow premium natural de 1.2 kg, sin embargo, al intentar registrar el código de barras me aparece un mensaje que indica que el código es incorrecto, y en las cajas el código es el mismo, quisiera saber cómo me podrían ayudar para poder participar.  Por otra parte, quisiera saber por qué empresa envían los premios, ya que en la primera caja que compré gané una mochila y hasta el momento no me ha llegado.\n\nEspero su respuesta.  Muchas gracias,\n\nPenélo'), ('5799', 'Alexandra Arellano', '2266074', '2015-06-30 15:51:54', 'alexarellano16@hotmail.com', 'Buenas tardes me gane una mochila doki me registre pero no me la han entregado gracias'), ('5800', 'Armando Arteaga Lopez ', '0986835043', '2015-06-30 22:54:21', 'donquino122@gmail.com', '05158\n05172\n05233\nHola disculpen  una pregunta como se si con estos códigos  tengo premios  o para que aplican  por favor '), ('5801', 'Ecdies Dianed Guadalupe Calderon Jupiter', '0994935659', '2015-06-30 23:54:13', 'bebesitadc@hotmail.com', 'Quisiera q me llamaran para q me cofirme la respectiva entrega del premio'), ('5802', 'MAURO SALOMON CUENCA ARMIJOS', '0986943571', '2015-07-01 15:50:43', 'mauri142@hotmail.com', 'Buenas tardes, cómo están? Quisiera saber si es verdad que van a entregar los premios que nos indicaron que habíamos ganado cuando enviamos los últimos 5 dígitos del código de barras. Yo recibí un mensaje donde me indicaban que había ganado una lonchera de Doki pero ya ha pasado un mes y no he recibido el premio y mi hijo todos los días me pregunta cuando va a tener su lonchera de Doki. Por favor contesten.\nSaludos\n\nMauro Cuenca'), ('5803', 'Raffaella Martrus Alejandro', '2078090', '2015-07-02 11:08:36', 'raffito_2@hotmail.com', 'Buen dia, quisiera expresar mi mal estar, ya que hasta la fecha e recibido mis premio, quisiera saber donde me hacerco a retirarlo porq a casa jamas me a llegado soy fiel consumidora mi hija toma 2 cartones de 1200gr a la semana y me parece una burla que engañen de esta manera a las personas ya los ultimos cartones que compre no los ingrese. \nEspero que me respondan ya sea por mail o con alguna llamada para poder retirar mi premio. Gracias'), ('5804', 'Nancy Gonzalez', '0981267675', '2015-07-02 13:28:36', 'nancy_zoraida21@hotmail.com', 'Buenos días, no he recibido respuesta al correo enviado anteriormente, acerca del premio ganado de 1 mochila Doki, recibí el código en el celular y lo ingrese en la pagina el 29 de mayo y no me ha llegado la mochila, \nA la espera de una respuesta,\n\nSaludos..'), ('5805', 'RAMIRO JAVIER BONILLA YANEZ', '0979646856', '2015-07-02 18:06:32', 'javierbonilla1986@hotmail.com', 'Muy buenas tardes veo que el premio que me gane que es la mochila de doki ya no me van hacer llegar porque ya estamos julio gracias por crear falsas espectativas con la compra de este producto todavia tengo el mensaje con el codigo y el premio para publicar que nunca cumplieron con la promocion que hicieron publicidad del producto y nunca tuve una respuesta por este medio de comunicacion de ante mano gracias de nada '), ('5806', 'jessica loja plaza ', '0993080562', '2015-07-03 17:49:28', 'jessik_88c@hotmail.com', 'Buenas tardes cuando me entrgan la mochila que gane con enfagrow premium me enviaron  una notificacion pero hasta el dia de hoy nada..... me llamaron para pedirme mi direccio n pero no se ubicaban les pedi de favor que me dijeran a que agencia de envios podia ir a retirar pero me dijeron que en 15 minutos me llaman pero ya va a ser un  mes y nada quisiera saber si me lo van a entregar o mejor me olvido de ese premio por favor seriedad en este caso...... mi bb toma esta leche desde que nacio hast'), ('5807', 'lorena castro yulan', '0995566353', '2015-07-04 23:00:31', 'lcastro12082012@yahoo.com', 'estimados yo registre mis datos en su pagina web, soy una mamita que le da a su hijo sus productos, en una ocasion me hicieron llegar al que era mi lugar de trabajo un sobresito con una fundita de leche de 400 gramos, favor su ayuda para cambiar el dato de direccion de mi casa que es Urb. Villa del Rey , etapa Rey Arturo , manz. 12 villa 19, el telefono es el 2732418 - 0995566353. muchas gracias'), ('5808', 'Kerly Alava', '042114454', '2015-07-07 00:10:15', 'kerlycita@live.com', 'Srs. Enfagrow... Nunca recibi la lonchera que me gane enviando el codigo x mensaje de texto... les escribi por este medio y me dijeron que pronto me la harian llegar pero eso aun no pasa. Digan la verdad si es una falsa esas promociones que sacan. o si tienen algun problema en llegar a mi domicilio denme alguna direccion donde yo pueda ir a retirar mi premio. '), ('5809', 'emilia peña ', '0959997071', '2015-07-08 10:53:55', 'yskp_13@hotmail.com', 'Buenos dias \nYo ingrese el codigo en esta paguina pero aun no tengo un correo o un mensaje o una llamada de su parte diciendome si ya puedo o en donde lo puedo retirar, quiero saber como puedo hacer para saber si en realidad tengo el premio de la mochila de doki que fue el premio obtenido o en caso de tener que ir a retirarlo en la ciudad de Quito puedo enviar a mi esposo a hacer el retiro ya que yo me encuertro fuera de la  ciudad. \nEspero su pronta respuesta.\nGracias.'), ('5810', 'Johanna Erazo Garzon', '0991258165', '2015-07-08 11:14:51', 'johanna_jessi@hotmail.com', 'Buen dia, yo participe y gane enviando codigos con la promocion de las mochilas de doki pero ya de eso casi 2 meses no han llegado nada, ni se de la participacion de las entradas para ver a doki.\nGracias.'), ('5811', 'Maria Jose Dominguez ', '0980078600', '2015-07-08 14:56:34', 'mj_dominguezl_11@hotmail.com', 'Estimados \nYo envie el 3 de junio los 5 ultimos digitos  del codigo de barras 05233 recibi un mensaje donde me indicaban que era una de las ganadores de una lonchera DOKI que me registre en esta pagina con el codigo CPB9LN , ME REGISTRE  e indicaron que en un laxo de 15 dias me entregarias el premio y ya ha pasado mas de un mes y no he recibido nada favor alguna respuesta sobre este inconveniente indicarme donde puedo retirar la lonchera  '), ('5812', 'ADRIANA JARAMILLO GARCIA', '0979029009', '2015-07-08 22:38:39', 'adriana_5673@hotmail.com', 'INGRESE MIS DATOS Y ME GANE UNA MOCHILA DE DOKI ESO FUE EL 10 DE MAYO Y AUN NO ME LLEGA EL PREMIO SOLICITO SE ME CONTESTE MI INQUIETUD LO MAS PRONTO POSIBLE YA SON 2 MESES DE ESPERA. GRACIAS.'), ('5813', 'Erika Viviana Cortez Villavicencio', '0981053250', '2015-07-08 23:25:13', 'vivi_2k@hotmail.com', 'Estimados exactamente el 28  de mayo del 2015 participe en la enfapromo envie el mensaje de texto y me respondieron que habia ganado UNA MOCHILA ingrese el codigo y segui todos los pasos como lo indicaba la pagina quisiera una respuesta porque di mi direccion y todos los datos para que llegue dicho premio ya a pasado un mes , quedaria muy agradecida que me dieran una respuesta \nSaludos,\nERIKA CORTEZ\nciudad de Milagro, Provincia del Guayas'), ('5814', 'JESSENIA PAREDES ROBLES', '0999108593', '2015-07-09 12:52:08', 'uby_martin@hotmail.com', 'buenos dias disculpe la molesti me pueden confirmar cuando me entregan el premio en el mensaje me salio que me gane una lonchera de doki gracias espero su respuesta y tambien como saber si me gane el un año de leche que sortearon en donde y cuando '), ('5815', 'Vanessa Montiel', '2492453-09', '2015-07-09 14:06:28', 'vanessa.montiel@soprofon.ec', 'Tengo un mes esperando y no recibo mi premio ni nadie se comunica conmigo.\nDen algún teléfono para contactarme, mi hijo se ilusionó con el premio, y no llega.\n'), ('5816', 'FANNY MARIA SANCHEZ APOLO', '072517118 ', '2015-07-09 14:36:12', 'fannysglendatur@hotmail.com', 'Buenas tardes nuevamente les escribo aún no he recibido la mochila que supuestamente es el premio que gané al enviar el código de los últimos 5 dígitos de la promoción ENFAPROMO. Les he escrito por este medio ya que no hay otro como comunicarse con ustedes pero hasta ahora no he recibido ninguna respuesta y peor aún el premio. Estoy comenzando a creer que es una farsa, mas me da pena por mi hijo que estaba tan ilusionado que habíamos ganado la mochila de Doki y jamás llega dicho premio. '), ('5817', 'MAURO SALOMON CUENCA ARMIJOS', '073088691 ', '2015-07-09 14:46:24', 'mauri142@hotmail.com', 'Buenas tardes: Quisiera saber si los premios que prometieron en verdad van a entregar porque yo envié el código y me contestaron que había ganado una lonchera de Doki pera hasta la fecha no he recibido nada. Mi esposa también envió y recibió un mensaje que había ganado una mochila pero tampoco ha recibido nada. Por favor necesitamos respuesta a nuestros correos electrónicos para saber si en realidad van a entregar o no los premios o sino para decirle a nuestro hijo que no siga esperando su lonch'), ('5818', 'elizabeth tubay', '2843990', '2015-07-09 17:23:10', 'etubay@seruvi.com', 'Hola, como están yo participe en esta promoción de Enfagrow para conocer a DOKI y me gane una mochila pero mis datos que registre fueron de mi domicilio que es en la 44 y la Ó suburbio Oeste entrando por la 29 y la Ó al fondo antes del estero salado si no peuden llegar y se es factible pueden hacerlo llegar a mi direccion del trabajo que es en el C. C. City Mall en la Adminstracion que esta ubicada en la Terraza \nMuchas gracias por su ayuda.  Bendiciones'), ('5819', 'Solange Orobio', '0991202104', '2015-07-09 19:01:10', 'sor1112@hotmail.com', 'yo participe con los codigos el mes pasado quiesiera saber cuando me llega ria el premio segun el mensaje era una lochera DOKI y respecto al año de productos gratis que posibilidad de que me digan si gane o no'), ('5820', 'FRANCO BAJAÑA DANIEL SAUL', '0958860348', '2015-07-10 11:11:10', 'santijoelfranco@hotmail.com', 'Buenos dias mi consulta es yo me registre por el premio de una mochila pero hast ala vez eh recibido alguna notificacion acerca del premio a retirar \nDe antemano gracias por la atencion a la presente esperando un a pronta respuesta me suscribo\nDaniel Franco Bajaña'), ('5821', 'Alexandra Espinoza Vanegas', '2732502', '2015-07-10 11:38:42', 'ingrid.alita@gmail.com', 'Estimados, buenos dias.\n\nInformo que me llego hace un mes aproximadamente el mensaje de que había sido ganadora de una lonchera,  ingrese los datos solicitados por la pagina web según en las condiciones indica que en el lapso de 15 días seria entregado dicho premio, pero hasta la actualidad no e recibido nada ni se han comunicado conmigo.\n\nFavor ayúdeme con este inconveniente e indicándome la información respectiva.\n\n\nSaludos\n\nAlexandra Espinoza'), ('5822', 'Lissette Granda', '0985335232', '2015-07-13 02:17:21', 'lizgranda_92_07@hotmail.com', 'Buenas me encantaria ser ganadora de este premio siempre utilizo esta leche ya que es super buena he intentado muchas veces  ingresar al sorteo y siempre se bloquea la pagina el ultimo codigo que he ingresado de un tarro que compre esta noche es  8PRNW4.\nespero tener buena suerte.\nGRACIAS'), ('5823', 'DIANA JESSENIA MORA AVILES', '043120099', '2015-07-13 13:43:58', 'dianamora1980@hotmail.com', 'BUENAS TARDES HACE DIAS ME GANE UNA MOCHILA Y HASTA AHORA NO ME LA ENTREGAN O COMO PODRIA RECLAMAR MI PREMIO...GRACIAS'), ('5824', 'Maria Gabriela Muentes Aviles', '042365905', '2015-07-14 14:36:12', 'makeile_1902@hotmail.com', 'mi hija ya recibio su premio mil gracias....... y con enfagrow mi hija hasta los 5 años'), ('5825', 'Jazmín vivíana montece armijos', '0980860184', '2015-07-14 16:04:10', 'Vjmont5@Hotmail.com', 'Siempre compro la leche y nunca me dan promociones o regalos eje gracias '), ('5826', 'ANDREA ALEJANDRA ZUÑIGA OLEAS', '0990970010', '2015-07-14 17:42:07', 'andyzol@hotmail.com', 'Hola yo envie un msj. y uds me enviaron un msj de que habia ganado una lonchera Doki,  ahora a pasado mas de una semana y no me llega ninguna lonchera. Quisiera saber si es verdad esto de lo que gane.  De ante mano gracias.'), ('5827', 'Madelaine Ramirez ', '089511468', '2015-07-14 18:12:53', 'made_9017@hotmail.com', 'Mi esposo ingreso el codigo que venia en la caja nos llego un mensaje de que habia ganado una maleta y no ha llegado el premio aun a mi domicilio. del numero que se escribio es 0995162450 '), ('5828', 'ALEX JAVIER IZA VARGAS', '0986262809', '2015-07-14 23:40:16', 'alex_1_5@hotmail.com', 'hola no me ha llegado el premio de la lonchera favor comunicarme para cuando se realizara la entrega'), ('5829', 'CIRA CARINA BRAVO AVILES', '0986130931', '2015-07-14 23:47:16', 'carina.1519@hotmail.com', 'no me llegan las loncheras favor comunicar eso tiene ya tiempoque se envio los codigo'), ('5830', 'MARIA TERESA AVILES MACIAS', '0993012589', '2015-07-14 23:48:28', 'alex_1_5@hotmail.com', 'hola\nnecesito informacion para cuando me van hacer llegar el premio que me he ganado '), ('5831', 'German Reinaldo Fernandez Zapata', '0997305478', '2015-07-15 14:31:16', 'reinaldofernandezz@hotmail.com', 'Buenas tardes estimados con fecha 23/04/2015 envie un SMS  con los últimos 5 dígitos cod barra luego recibi un mensaje donde indicaba que era acreedor a 1 lonchera Doki (código YGWD2H)) ingrese en la pag www.enfapromo.com y hasta la fecha me hacen llegar el premio, favor atender\ngracias'), ('5832', 'MADELAINE RAMIREZ MARQUEZ', '0989511468', '2015-07-15 18:56:29', 'made_9017@hotmail.com', 'ESTIMADOS \nEL DIA DE AYER 15 DE JULIO ESCRIBI A USTEDES PARA RECIBIR UNA RESPUESTA, DADO QUE CON MI ESPOSO RECIBIMOS UN MENSAJE DE QUE HABIA GANADO UNA MOCHILA, HICIMOS LOS PASOS CORRESPONDIENTES PERO AUN NO HA LLEGADO LA MALETA DESPUES DE CASI 2 MESES. LE QUEDARIA MUY AGRADECIDA POR UNA PRONTA RESPUESTA. \nMUY ATENTAMENTE \nMADELAINE RAMIREZ\n'), ('5833', 'ANGELICA LORENA CORONEL PALMA', '0988049207', '2015-07-16 00:00:31', 'acoronel77@hotmail.com', 'estimado me gane una lonchera pero has