drade', '2578301', '2015-07-23 16:52:18', 'jorge0344villanueva@hotmail.com', 'Buen dia aun espero la invitacion via correo la ual me llamaron a confirmar datos q segun gane en el sorteo para el show de DOKI\n'), ('5884', 'fernanda coronel cabrera', '0958931237', '2015-07-23 17:13:33', 'coronelf92@gmail.com', 'buena tardes\nme llamaron indicando que mi hijo salio ganador para una etrada al evento doki este sabado 25 de julio centro de convenciones... Pero para poder asistir me tiene que llegar una invitacion a mi correo cosa que todavia no llega  nadaa '), ('5885', 'FABIAN MUÑIZ ', '0989996525', '2015-07-23 17:58:49', 'fabianmarcelo2008@hotmail.com', 'Recibi una llamada el dia de ayer 22/07/2015, indicando que habia ganado  un pase para llevar a mi hija al show de doki, que me iban a enviar la invitacion por correo pero no llego el mensaje ni como correo no deseado, si serian tan amables de reenviar la invitacion para poder asistir al evento. \na la espera de una pronta respuesta, ya que el evento es el domingo 26/07/2015'), ('5886', 'katherine johanna gonzalez gonzalez', '0991306726', '2015-07-23 18:10:45', 'katherinejohannagonzalez@hotmail.com', 'Disculpe quiero saber cuando me mandara la tarjeta de invitacion sobre a conocer doki porque me llamaron el dia de ayer que mi hijo salio premiado a conocer a doki y me dijieron que iba a mandar la tarjeta de invitacion por medio de correo electronico'), ('5887', 'Katherine Zurita Sancan', '0997373268', '2015-07-23 18:17:49', 'kdsierraz@hotmail.com', 'me llamaron el día de ayer miércoles 22 de julio para informarme que mi hija había sido ganadora para ver a doki y le dijeron a mi esposo que me enviarían por mail la invitación y hasta hora no me llega nada.  Quisiera saber cuando me llegaría la invitación ya que el sábado es elshow'), ('5888', 'vanessa de lourdes vargas mieles', '2055340', '2015-07-23 18:56:53', 'peggythebest-81@hotmail.com', 'hola quisiera saber si la invitacion de doki me la envian a mi facebook'), ('5889