, ('5894', 'Neida Solange Cruz Tomala', '0986309685', '2015-07-23 23:07:47', 'solangecruz_1284@hotmail.com', 'Buenas noches disculpe la molestia pero quisiera comunicarme con ustedes para realizarle una pregunta sobre el premio de la entrada para ir a ver a Doki'), ('5895', 'sandy choez', '0993650790', '2015-07-23 23:12:51', 'marisol_84@hotmail.com', 'hola me gane una entrada para conocer a doki \nel sabado 25 en el centro de convenciones\'  quedaron en enviarme la entrada por correo pero no me llega   mi correo es marisol_84@hotmail.com  xfavor responda gracias\n'), ('5896', 'Evelin morocho', '0983852982', '2015-07-23 23:25:04', 'evelin.morocho@yahoo.com', 'Me llamaron indicando q había ganado entradas para ver doqui el sábado. No me ha llegado el detalle aún a mi correo. X favor para que me ayuden facilitando la entrada');
INSERT INTO `doky_contactanos` VALUES ('5897', 'juliana juca coello', '2026426', '2015-07-24 00:35:30', 'juli-juka98@hotmail.com', 'Buenas noches me dirijo a usted por motivo de que recibí una llamada que gane una entrada para conocer a doki y me dijeron que tenia que revisar mi correo pero no eh recibido nada en mi hotmail y para poder entrar necesito llevar eso impreso \n¿me podrían ayudar en eso?'), ('5898', 'juliana juca ', '2026426', '2015-07-24 00:35:35', 'juli-juka98@hotmail.com', 'Buenas noches me dirijo a usted por motivo de que recibí una llamada que gane una entrada para conocer a doki y me dijeron que tenia que revisar mi correo pero no eh recibido nada en mi hotmail y para poder entrar necesito llevar eso impreso \n¿me podrían ayudar en eso?'), ('5899', 'CARMEN MOSQUERA', '3654108', '2015-07-24 10:49:58', 'orion_yan@hotmail.com', 'Mi madre recibió la llamada en domicilio para que mi hijo imprima del correo electrónico la invitación para para conocer y aprender junto al personaje Doki™.  pero no me ha llegado nada a mi email favor enviarme para poder asistir gracias '), ('5900', 'martha armas rodrigo', '2093415', '2015-07-24 11:57:25', 'marthaarmas@hotmail.com', 'buenos dias me llamaron para conocer a Doki mañana en  el patio del centro convenciones.Me dijieron que me enviaban la invitacion por correo,pero hasta el dia de hoy no me llega.\nPor favor como hago mi niña quiere asistir envieme por favor la invitacion a mi correo marthaarmas@hotmail.com\nGracias'), ('5901', 'genesis espinoza espinoza ', '2145214', '2015-07-24 12:19:09', 'genesisespinozaespinoza@hotmail.com', 'M llamaron que mi hij habia salido favorecido para conocer a doki quedaron en enviarme la invitacion al correo pero no me ha llegado como ingreso el dia sabado ???'), ('5902', 'maria porras', '0991755685', '2015-07-24 13:14:26', 'maryafer88@hotmail.com', 'hola amigos mi niño se gano una entrada para ir a ver a doki  25/07/15 pero aun no me la envian a mi correo como puedo hacer gracias y