ico no he recibido ninguna  notificacion que puedo hacer. y el evento es mañana\ngracias'), ('5915', 'JENNIFER QUIMIS QUIMIS', '0969680110', '2015-07-24 23:42:58', 'j-quimis@hotmail.com', 'buenas noches.\nnecesito de su ayuda me llamaron que me había ganado la entrada para ver a doki pero nunca me llego mañana es el evento y no me llego la invitación digital\n\nayúdeme enviandola de nuevo, se lo agradecería mucho, mi correo es j-quimis@hotmail.com  \n\nsaludos \nJennifer Quimis'), ('5916', 'katherin lissette espinoza gomez', '0968896181', '2015-07-24 23:43:25', 'laflak_kata@hotmail.com', 'buenas noches el dia miercoles me llamaron a decirme que me habia ganado una entrada para conocer a doki doki y me dijeron que la invitacion me la mandaban por correo y hasta la fecha me llaga para imprimirla?? asi mismo mi lata salio favorecida para una mochila la cual nunca me llego a mi domicilio haganmen el favor de responder... gracias '), ('5917', 'Fernanda Fiallos', '0992669296', '2015-07-24 23:49:41', 'fernandafiallos@ubg.com.ec', ' Buenas noches me llamaron para indicarme que mi hija Daniela Gallo fue seleccionada para conocer a Dokky y que me enviarian una invitacion a mi mail para presentar a la entrada, pero aun no he recibido nada, y mañana es el evento.  Espero mañana nos dejen entrar sin problema. '), ('5918', 'maritza zambrano cedeno', '042176461', '2015-07-25 01:24:03', 'maritza.azc@hotmail.com', 'Buenas noches por favor demen una solucion me gane entradas a la presentacion de doki q es en guayaquil manana 25 de julio pero aun no me llega la invitacion a mi correo  ayudenme sean cumplido  '), ('5919', 'maritza zambrano cedeno', '0985439287', '2015-07-25 01:35:50', 'maritza.azc@hotmail.com', 'Buenas noche el motivo de mi visita es que recibi la llamada q me gane una entrada para ver a doki en guayaquil  ecuador el  sabado 25 y aun no recibo la invitacion a mi correo para poder asistir ayudenme por favor '), ('5920', 'maritza zambrano cedeno', '0985439287', '2015-07-25 08:11:19', 'maritza.azc@hotmail.com', 'Buenos dias por favor ayudenme con la invitacion de la presentacion de doki me llamaron  el marte q megane tres  entrada  y hasta el dia de hoy no me envian las  invitaciones a mi correo maritza.azc@hotmail.com y hoy ya es la presentacion en guayaquil ecuador el 25 de julio '), ('5921', 'jenny galarza', '3083043', '2015-07-25 13:19:01', 'jegalarza2@hotmail.com', 'hola que tal ..como se que me gane algo '), ('5922', 'vanessa de lourdes vargas mieles', '2055340', '2015-07-25 14:09:38', 'peggythebest-81@hotmail.com', 'quisiera saber porque no me ha llegado la invitacion para imprimirla\n'), ('5923', 'Neida Solange Cruz Tomala', '0986309685', '2015-07-25 15:22:34', 'solangecruz_1284@hotmail.com', 'Buenas tardes por favor su ayuda , participe en en la promomocion de ENFAGROW APRENDIENDO CON DOKI y me gane una entrada para conocer a DOKI en guayaquil  mi pregunta es tengo q llevar algun docummento y por que persona preguntaria para poder ingresar al evento.\nEsperando su pronta ayuda gracias'), ('5924', 'MAYRA ALEJANDRA MOREIRA MOSCOSO', '2185298', '2015-07-25 15:40:36', 'mayra_21_1992@hotmail.com', 'no he recibido el premio de la lonchera para mi hija por favor comuniquense'), ('5925', 'Aracely', '0984961937', '2015-07-25 18:56:30', 'nathy_r24@hotmail.com', 'Hola como veo las fotos tomadas hoy en la casa de la cultura.. Gracias'), ('5926', 'jessenia ordoñez', '0969635001', '2015-07-26 01:32:34', 'jesse-or@outlook.es', 'buenas gane una de las mochilas doki y no m ha llegad pueden enviarml a mi trabajo n el riocentro sur de guayaquil el la av. 25 de julio (rio store del hiper market) gracias\n'), ('5927', 'Miguel Ordonez', '0995102400', '2015-07-28 12:45:49', 'maor_donez@hotmail.com', 'Estimados,\nDe donde puedo descargar la foto con DOKI\nSaludos\n'), ('5928', 'JENIFFER KARINA BAILON BAILON', '0939281668', '2015-07-28 18:11:45', 'yekarybailon@hotmail.com', '05158 05172'), ('5929', 'Jeniffer Robalino', '0979550029', '2015-07-28 19:37:16', 'NICKELONE_SFREE@HOTMAIL.COM', 'QUIERO VER LAS FOTOS DE LA VISITA CON DOKI EN LA CASA DE LA CULTURA PORFABOR ME PUEDEN ENVIAR O DARME UNA PAGINA PARA ACCEDER A LAS FOTOS PORFABOR'), ('5930', 'Marycela Raquel Gonzalez  Valverde', '0993583948', '2015-07-28 21:54:18', 'marycela_oliver@hotmail.com', 'Buenas noches por favor donde puedo buscar mi foto que me teme el dia domingo 26 de julio 2015 . son dos fotos.\ngracias'), ('5931', 'kathiuska Baidal', '0982741497', '2015-07-31 02:51:37', 'kathiuskabaidal@hotmail.com', 'Necesito ver la foto que nos tomamos con Doki el domingo 26 de julio, se me perdió la clave con que concurse, ayúdame por favor. Gracias.\n'), ('5932', 'gonzalo', '0984775380', '2015-08-01 10:18:56', 'yascual_2008@hotmail.com', 'Un cordial saludo mi motivo x le cual me suscribo ante ustedes es desear saber como podemos ver y en que parte se encuentran las fotos de los ñiños con el perro doki q fueron tomadas en la casa de la cultura;espero su respuesta mil gracias'), ('5933', 'Nombre *Andrea Milena Almanza Ibarra', '099869192', '2015-08-02 14:39:13', 'andrea.almanza@lavca.com.ec', 'Buenos Dias hubo un concurso en el cual mi hija salio elegida par a sisitir  a la casa de la cultura y tomar unas fotos pero no las he podido encontrar.\nLes agradezco mucho si me ayudan a ubicar las fotos o me dan la direccion de correo electronico para bajarlas.\n\nGracias.\nAndrea Almanza'), ('5934', 'Marycela Raquel Gonzalez Valverde', '043871437', '2015-08-02 17:46:31', 'marycela_oliver@hotmail.com', 'Buenas tarde:\nPor  favor digame para cuando estan las fotos con Doki.... la estoy espernado y nada.  y mis premios aun no me llegan.... digame que pasa?\nesta es mi direccion completa: oconnor 114 y gallegos Lara \npor una farmacia cruz azul \ngracias\nMarycela'), ('5935', 'xiomara olmedo', '0993942734', '2015-08-02 18:40:15', 'xiomyto_91@outlook.com', 'por favor me podrian ayudar con las fotos q nos tomamos en el evento con doki  q me dijeron q ingresemos a esta pagina y q nos enviarian aqui las fotos y nada soy de guayaquil. \ngracias....\n');
