-- ----------------------------
-- Table structure for doky_ganadores
-- ----------------------------
DROP TABLE IF EXISTS `doky_ganadores`;
CREATE TABLE `doky_ganadores` (
`id`  int(11) NOT NULL AUTO_INCREMENT ,
`pin`  varchar(25) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`premio`  varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`ganador`  char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '0' ,
`creado`  timestamp NULL DEFAULT CURRENT_TIMESTAMP ,
`estado`  char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '0' ,
PRIMARY KEY (`id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
AUTO_INCREMENT=2002

;

-- ----------------------------
-- Records of doky_ganadores
